import React from "react";

const CardContact=(props)=>{
    const {id, name, email, phone, address}=props.contact;
    return(
        <div className="item">
        <div className="content">
          <div className="header">{name}</div>
          <div>{email}</div>
          <div>{phone}</div>
          <div>{address}</div>
        </div>
        <i className="trash alternate outline icon"
         style={{color:red}}></i>
    </div>
    );
}
